    false,nt"url": null,nt"notes": "This annual narrative report for Chautauqua
    National Wildlife Refuge outlines Refuge accomplishments during the 1987 calendar
    year. The report includes a planning section which discusses the management plan,
    public participation, compliance with environmental mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands. The wildlife section of the report discusses endangered
    and threatened species, migratory birds, game mammals, fisheries resources, and
    marking and banding. The public uses of the Refuge described in this report include
    interpretive programs, hunting, fishing, wildlife observation, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, communications, and energy conservation. Cooperative programs and items
    of interest are provided at the end. Photographs are attached. Narrative report
    on the Cameron-Billshach Unit of Chautauqua National Wildlife Refuge and Meredosia
    National Wildlife Refuge is included.",nt"license_title": "License Not Specified",nt"extras":
